import React,{useState} from 'react';

const FormRegis = () => {
    const [email, setEmail] = useState('');
    const [pass, setPass] = useState('');

    const handleChange = (e) =>{
        setEmail(e.target.value)
        // setPass(e.target.value)
        console.log('email: ',email,'password: ',pass)
    }
    return (
        <div>
            <form>
                {/* <div class="mb-3">
                    <input type="text" class="form-control" id="exampleInputPassword1" placeholder='username'/>
                </div> */}
                <div class="mb-3">
                    <input type="email" onChange={handleChange} value={email} class="form-control" id="exampleInputEmail1" placeholder='email' aria-describedby="emailHelp" />
                </div>
                <div class="mb-3">
                    <input type="password" onChange={handleChange} value={pass} class="form-control" id="exampleInputPassword1"  placeholder='password' />
                </div>
                <div className="submit d-flex align-items-center">
                    <button type="submit" class="btn btn-danger me-3">Login</button>
                    or

                    <button type="submit" class="btn">Login With Google</button>
                </div>
            </form>
        </div>
    );
}

export default FormRegis;
